'use strict';

import React, { useCallback, useMemo, useRef, useState, StrictMode} from 'react';
import { createRoot } from 'react-dom/client';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-charts-enterprise';
import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-quartz.css';
import './styles.css';







const GridExample = () => {
    const gridRef = useRef();
    const containerStyle = useMemo(() => ({ width: '100%', height: '100%' }), []);
    const gridStyle = useMemo(() => ({height: '100%', width: '100%'}), []);
    const [rowData, setRowData] = useState();
    const [columnDefs, setColumnDefs] = useState([
    { field: 'athlete', minWidth: 150 },
    { field: 'age', maxWidth: 90 },
    { field: 'country', minWidth: 150 },
    { field: 'year', maxWidth: 90 },
    { field: 'date', minWidth: 150 },
    { field: 'sport', minWidth: 150 },
    { field: 'gold' },
    { field: 'silver' },
    { field: 'bronze' },
    { field: 'total' },
]);
    const defaultColDef = useMemo(() => { return {
    flex: 1,
    minWidth: 100,
    editable: true,
} }, []);
    const processCellForClipboard = useCallback((params) => {
    if (params.column.getColId() === 'athlete' &&
        params.value &&
        params.value.toUpperCase) {
        return params.value.toUpperCase();
    }
    return params.value;
}, []);
    const processCellFromClipboard = useCallback((params) => {
    if (params.column.getColId() === 'athlete' &&
        params.value &&
        params.value.toLowerCase) {
        return params.value.toLowerCase();
    }
    return params.value;
}, []);


            const onGridReady = useCallback((params) => {


                fetch('https://www.ag-grid.com/example-assets/olympic-winners.json')
                .then(resp => resp.json())
                .then(data => setRowData( data));
            }, []);

const onRangeDeleteStart = useCallback((event) => {
    console.log('onRangeDeleteStart', event);
}, [])

   const onRangeDeleteEnd = useCallback((event) => {
    console.log('onRangeDeleteEnd', event);
}, [])

   const onRangeSelectionChanged = useCallback((event) => {
    var lbRangeCount = document.querySelector('#lbRangeCount');
    var lbEagerSum = document.querySelector('#lbEagerSum');
    var lbLazySum = document.querySelector('#lbLazySum');
    var cellRanges = gridRef.current.api.getCellRanges();
    // if no selection, clear all the results and do nothing more
    if (!cellRanges || cellRanges.length === 0) {
        lbRangeCount.textContent = '0';
        lbEagerSum.textContent = '-';
        lbLazySum.textContent = '-';
        return;
    }
    // set range count to the number of ranges selected
    lbRangeCount.textContent = cellRanges.length + '';
    var sum = 0;
    if (cellRanges) {
        cellRanges.forEach((range) => {
            // get starting and ending row, remember rowEnd could be before rowStart
            var startRow = Math.min(range.startRow.rowIndex, range.endRow.rowIndex);
            var endRow = Math.max(range.startRow.rowIndex, range.endRow.rowIndex);
            for (var rowIndex = startRow; rowIndex <= endRow; rowIndex++) {
                range.columns.forEach((column) => {
                    var rowNode = gridRef.current.api.getDisplayedRowAtIndex(rowIndex);
                    var value = gridRef.current.api.getValue(column, rowNode);
                    if (typeof value === 'number') {
                        sum += value;
                    }
                });
            }
        });
    }
    lbEagerSum.textContent = sum + '';
    if (event.started) {
        lbLazySum.textContent = '?';
    }
    if (event.finished) {
        lbLazySum.textContent = sum + '';
    }
}, [])

   const onAddRange = useCallback(() => {
    gridRef.current.api.addCellRange({
        rowStartIndex: 4,
        rowEndIndex: 8,
        columnStart: 'age',
        columnEnd: 'date',
    });
}, [])

   const onClearRange = useCallback(() => {
    gridRef.current.api.clearRangeSelection();
}, [])

    return  (
            <div style={containerStyle}>
                <div className="example-wrapper">
    <div className="example-header">
        <button onClick={onAddRange}>Add Range</button>
        <button onClick={onClearRange}>Clear Range</button>
        Range Count:
        <span id="lbRangeCount" style={{"paddingRight":"20px"}}></span>
        Eager Sum:
        <span id="lbEagerSum" style={{"paddingRight":"20px"}}></span>
        Lazy Sum:
        <span id="lbLazySum" style={{"paddingRight":"20px"}}></span>
    </div>

        <div style={gridStyle} className={/** DARK MODE START **/document.documentElement.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/}>
            <AgGridReact
                ref={gridRef}
                rowData={rowData}
columnDefs={columnDefs}
defaultColDef={defaultColDef}
enableRangeSelection={true}
processCellForClipboard={processCellForClipboard}
processCellFromClipboard={processCellFromClipboard}
onGridReady={onGridReady}
onRangeDeleteStart={onRangeDeleteStart}
onRangeDeleteEnd={onRangeDeleteEnd}
onRangeSelectionChanged={onRangeSelectionChanged}
            />
        </div>
</div>
            </div>
        );

}

const root = createRoot(document.getElementById('root'));
root.render(<StrictMode><GridExample /></StrictMode>);

